TITLE:
  - "Lungtest for flow and scalar transport in a deformable porous media"
  - "blood is modeled with the additional porous network with closing relation <blood lung>."
  - "This example tests the deformations dependence and the pressure dependence"
PROBLEM TYPE:
  PROBLEMTYPE: "porofluid_pressure_based_elasticity_scatra"
porofluid_elasticity_scatra_dynamic:
  total_simulation_time: 2.5
  time_integration:
    time_step_size: 0.1
    number_of_time_steps: 25
    theta: 1
  nonlinear_solver:
    maximum_number_of_iterations: 15
  output:
    result_data_every: 5
    restart_data_every: 5
  coupling_scheme: twoway_monolithic
  artery_coupling_active: false
porofluid_elasticity_scatra_dynamic/monolithic:
  nonlinear_solver:
    linear_solver_id: 1
IO/RUNTIME VTK OUTPUT:
  INTERVAL_STEPS: 1
IO/RUNTIME VTK OUTPUT/STRUCTURE:
  OUTPUT_STRUCTURE: true
  DISPLACEMENT: true
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "OneStepTheta"
  LINEAR_SOLVER: 1
STRUCTURAL DYNAMIC/ONESTEPTHETA:
  THETA: 1
porofluid_dynamic:
  initial_condition:
    type: by_condition
porofluid_elasticity_dynamic:
  solve_structure: true
  coupling_scheme: twoway_monolithic
SCALAR TRANSPORT DYNAMIC:
  SOLVERTYPE: "nonlinear"
  MAXTIME: 2.5
  NUMSTEP: 25
  THETA: 1
  INITIALFIELD: "field_by_condition"
  SKIPINITDER: true
  LINEAR_SOLVER: 1
SCALAR TRANSPORT DYNAMIC/STABILIZATION:
  STABTYPE: "no_stabilization"
  EVALUATION_TAU: "integration_point"
  EVALUATION_MAT: "integration_point"
SCALAR TRANSPORT DYNAMIC/NONLINEAR:
  ITEMAX: 100
  CONVTOL: 1e-08
  ABSTOLRES: -1
SOLVER 1:
  SOLVER: "UMFPACK"
  NAME: "solver"
MATERIALS:
  - MAT: 1
    MAT_FluidPoroMultiPhaseReactions:
      LOCAL: false
      PERMEABILITY: 0.0012
      NUMMAT: 2
      MATIDS: [12, 13]
      NUMFLUIDPHASES_IN_MULTIPHASEPORESPACE: 1
      NUMREAC: 1
      REACIDS: [50]
  - MAT: 50
    MAT_FluidPoroSingleReaction:
      NUMSCAL: 2
