      PERMEABILITY: 0.00015
      VISCOSITY_LAW_ID: 141
      INITIALVOLFRAC: 0.1
      SCALING_PARAMETER_DEFORMATION: -0.1
      SCALING_PARAMETER_PRESSURE: -5.0
  - MAT: 141
